import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Welcome to the Home Page!</h1>
      <li>
          <Link to="/">Home</Link>
      </li>
    </div>
  );
}

export default Home;
